import React from 'react';
import { MdModeEdit, MdDeleteForever } from 'react-icons/md'

function Login({ login, onDelete, onEdit }) {
    return (
        <tr>
            <td>{login.website}</td>
            <td>{login.username}</td>
            <td>{login.password}</td>

            <td>
                <button onClick={ () => onEdit(login)}><MdModeEdit/></button>

                <button className='deleteButton' onClick={ () => onDelete(login._id)}><MdDeleteForever/></button>
            </td>

        </tr>
    );
}

export default Login;
